import React from "react";
import { useLocation, useNavigate } from "react-router-dom";
import "./Results.css";

const Results = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const result = location.state?.result; // Get results passed via state

    // Redirect back to Dashboard if no results are available
    if (!result) {
        navigate("/dashboard");
        return null;
    }

    return (
        <div className="results-page">
            <h1>Execution Results</h1>
            {result.length === 0 ? (
                <p>No results to display.</p>
            ) : (
                <div className="results-list">
                    {result.map((deviceResult, index) => (
                        <div key={index} className="device-card">
                            <h4>Device: {deviceResult.device}</h4>
                            <ul>
                                {deviceResult.results.map((action, idx) => (
                                    <li key={idx} className={`action-result ${action.result.status}`}>
                                        <strong>Action:</strong> {action.action} <br />
                                        <strong>Service:</strong> {action.service} <br />
                                        <strong>Status:</strong> {action.result.status} <br />
                                        <strong>Output:</strong>
                                        <pre>{action.result.output || "No output"}</pre>
                                        <strong>Error:</strong>
                                        <pre>{action.result.error || "No error"}</pre>
                                    </li>
                                ))}
                            </ul>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
};

export default Results;
